import React from 'react';
import { BottomSection, MainPhoto, MainPhotoContainer, MiddleSection, Title, TopSection, Wrapper } from './components';
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'
import eltonMain from './img/eltonMain.png';

function App() {
  const slideImages = [
    {
      url: eltonMain,
      caption: 'Slide 1'
    },
    {
      url: eltonMain,
      caption: 'Slide 2'
    },
    {
      url: eltonMain,
      caption: 'Slide 3'
    },
  ];



const spanStyle = {
  padding: '20px',
  background: '#efefef',
  color: '#000000'
}

const divStyle = {
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  backgroundSize: 'cover',
  height: '400px'
}

  return (
    <Wrapper>
    <TopSection>
      <Title>
        Adopt Elton
      </Title>
      <Slide>
        {slideImages.map((slideImage, index)=> (
          <div key={index}>
            <div style={{ ...divStyle, 'backgroundImage': `url(${slideImage.url})` }}>
              <span style={spanStyle}>{slideImage.caption}</span>
             </div>
           </div>
          ))} 
        </Slide>
    </TopSection>
    <MiddleSection>

    </MiddleSection>
    <BottomSection>
    </BottomSection>
    </Wrapper>
  );
}

export default App;
